import React,{Component} from 'react'
import {Pubu_warpper} from './style'

class Pubu extends Component {
  render(){
    return(
      <Pubu_warpper>
        <div className="floor">
          <h3 className="floor_hit">
            为你推荐
          </h3>
        </div>
      <div className="grid_c1"></div>
      </Pubu_warpper>
    )
  }
}

export default Pubu;
